#QueerOrientation at UofT is coming up soon! Sign-up now to join us and @uoftconsent for this virtual session with the incredible @whatsmybodydoing 🌈 Queer & trans students deserve a #SexEd space that centres queer and trans well-being and pleasure. In this shame-free, fun, and interactive workshop, we’ll learn communication frameworks, queer & trans inclusive pleasure anatomy, sex & dating beyond #cisheteronormative scripts, and bust myths about sexual health. Link in bio to register via Folio.

@uoftsgdo #UofT #UTogether #UofTOrientation #QO2024

A rainbow design is in the top left. A headshot of a person (Eva Bloom) is on the right - they are wearing a lime-green beanie, a navy and white button-up shirt, and have short red hair. A graphic of a happy star is in the bottom righthand corner of the image. Text reads: “The Queer and Trans Sex Ed You Should Have Gotten in High School with Eva Bloom. Thursday, Sept. 26. 11 a.m. - 1 p.m. Virtual via Zoom. UofT.Me/QueerSexEd2024.” Logos for the SVPS Centre and SEC are in the bottom left.
